window.bookSummaryJSON = "<p><b>Manipulation is the name of the game.</b></p> <p>Captain Jamie Callahan is running out of time in his efforts to outsmart an enemy metahuman. His father’s presidential campaign is ramping up, and Jamie’s top secret identity as a metahuman himself is at risk of being revealed by the enemy, to say nothing of his secret relationship with Staff Sergeant Kyle Brannigan. </p> <p>As Alpha Team’s long-running mission gets derailed in the worst way possible, Staff Sergeant Alexei Dvorkin discovers the enemy is playing for keeps, and neither he nor Agent Sean Delaney are in any position to escape what’s in store for them. </p> <p>But the other side has made one mistake that Jamie, Alexei, and Alpha Team are more than willing to exploit—you don’t mess with family unless you want to get hurt.</p>"; 
